import {useEffect,useState} from "react";
import List from "../models/List.js";
import {Link } from "react-router-dom";
function Results(){
    const [results,setResults] = useState();
    const [state,setState] = useState();
    const [date,setDate] = useState();
    const [cases,setCases] = useState();
    const [deaths,setDeaths] = useState();
    const [list,setList] = useState([]);
    const [page,setPage] = useState(0);
    const [pages,setPages] = useState();
    const [resultsPerPage,setResultsPerPage] = useState();


    const [isLoading,setisLoading] = useState(true);

    const config = (res)=>{
        setResults(res.results);
        setState(res.state);
        setDate(res.date);
        setCases(res.cases);
        setDeaths(res.deaths);
        setList(res.list);
        setPage(res.page);
        setPages(res.pages);
        setResultsPerPage(res.resultsPerPage);
    }
    useEffect(() => {
        if(isLoading){
            async function fetchMyAPI() {
                let response = await fetch('http://localhost:8000/api/home');
                response = await response.json();
                console.log(response);
                config(response);
                setisLoading(false);
            }
            fetchMyAPI();
        }
    });

    return (
        <div className="Results">
            <div className="card">

                {results &&<li class="list-group-item"><h5 className="card-title">Search Results:{results}</h5></li>}
                <div className="card-body">
                    <ul class="list-group">
                        {state &&
                            <li class="list-group-item">
                                <label>State:</label>{state}
                            </li>}
                        {date &&
                            <li class="list-group-item">
                                <label>Date:</label>{date}
                            </li>}
                        {cases &&
                            <li class="list-group-item">
                                <label>Cases:</label>{cases}
                            </li>}
                        {deaths &&
                            <li class="list-group-item">
                               <label>Deaths:</label>{deaths}
                            </li>}
                    </ul>
                </div>
            </div>
            <div className="List">
                <List props={list}/>
            </div>
        </div>
    );
}
export default Results
